----------------------------------------------------------------------------------------
-- Create Reference Table
----------------------------------------------------------------------------------------
CREATE TABLE IF NOT EXISTS public.Reference (
  ID BIGSERIAL NOT NULL,
  UUID uuid NOT NULL DEFAULT uuid_generate_v4(),
  Code integer NOT NULL,
  Short_Name varchar(50) NULL,
  Ref_Type varchar(35) NOT NULL,
  Title varchar(200) NOT NULL,
  Parent_ID bigint NULL,
  Type_ID bigint NOT NULL,
  Remark text NULL,
  Vec_Simple_Name tsvector,
  Other_Info jsonb NULL,

  CONSTRAINT Reference_pkey PRIMARY KEY (ID),
  CONSTRAINT fk_Reference_Parent FOREIGN KEY (Parent_ID) REFERENCES Reference(ID),
  CONSTRAINT fk_Reference_Ref_Type FOREIGN KEY (Type_ID) REFERENCES Reference_Type(ID)
);
CREATE UNIQUE INDEX IF NOT EXISTS idxReference_Code ON public.Reference(lower(Ref_Type), Code);
CREATE UNIQUE INDEX IF NOT EXISTS idxReference_ShortName ON public.Reference(lower(Ref_Type), lower(Short_Name));
CREATE UNIQUE INDEX IF NOT EXISTS idxReference_UUID ON public.Reference(UUID);
CREATE INDEX IF NOT EXISTS idxReference_RefTitle 
  ON public.Reference (lower(Ref_Type), LOWER(Title));

CREATE UNIQUE INDEX IF NOT EXISTS idxReference_Title 
  ON public.Reference (Type_ID, COALESCE(Parent_ID,0), LOWER(Title));

--------------------------------------------------------------------------------------------------
CREATE INDEX IF NOT EXISTS idx_Reference_lexeme 
--------------------------------------------------------------------------------------------------
  ON public.Reference 
  USING gin (Vec_Simple_Name);
--------------------------------------------------------------------------------------------------

---------------------------------------------------------------------------
-- INSERT Reference Trigger
CREATE or REPLACE FUNCTION Reference_INSERT() returns trigger AS 
---------------------------------------------------------------------------
$$ 
DECLARE 
   ctr int8 := Nextval('Mod_Ctr_seq');
   upd timestamptz := CURRENT_TIMESTAMP;

   SimpleName VarChar(1000);
   VecSimpleName tsvector;
   payload JSON;
  reftype varchar(35);
BEGIN
   payload = json_build_object( 
      'action', TG_OP,
      'table',  TG_TABLE_NAME::regclass::text,
      'data',  json_build_object( 
          'UUID', NEW.UUID,
          'Mod_Ctr', ctr
      ) 
   );
     
  INSERT INTO Main_Record(UUID, TableName, Mod_Ctr, Created)
  SELECT NEW.UUID, TG_TABLE_NAME::regclass::text, ctr, upd
  ON CONFLICT DO NOTHING;
   
  INSERT INTO Modified(Mod_Ctr, UUID, Updated)  
  SELECT ctr, NEW.UUID, upd;
  
  SELECT 
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Title::text, ''::text))), 'A'::"char") ||
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Short_Name::text, ''::text))), 'B'::"char") ||
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Parent::text, ''::text))), 'C'::"char") || 
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Ref_Type::text, ''::text))), 'D'::"char") VecSimpleName
     
  INTO VecSimpleName
  FROM 
   (SELECT 
      r.ID, r.Title, r.Short_Name, 
      COALESCE(p.Title,'') Parent, y.Title Ref_Type
      --Simpleword(r.Title::text ||  ', '::text || r.Short_Name || ', '::text ) Simple_Name,
      --Simpleword(COALESCE(', '::text || p.Simple_Name,'')) Parent, Simpleword(y.Title) Ref_Type
    FROM 
      (SELECT new.Id, new.Parent_Id, new.Title, new.Short_Name, new.Type_Id) r
    INNER JOIN Reference_Type y on y.Id = r.Type_Id
    LEFT JOIN Reference p on r.Parent_Id = p.Id
    ) p1;    
   
  reftype := (SELECT Title FROM Reference_Type WHERE ID = NEW.Type_Id);
  NEW.Ref_Type = reftype;

  NEW.Vec_Simple_Name = VecSimpleName;
  PERFORM pg_notify('mychan', payload::text);   
RETURN NEW;
END $$ Language plpgsql;
 

--------------------------------------------------------------------------------------------------
CREATE or REPLACE FUNCTION Reference_UPDATE() RETURNS TRIGGER Language plpgsql AS 
$function$ 
--------------------------------------------------------------------------------------------------
DECLARE 
  ctr int8 := Nextval('Mod_Ctr_seq');
  upd timestamptz := CURRENT_TIMESTAMP;
  SimpleName VarChar(1000);
  VecSimpleName tsvector;
  payload JSON;
  reftype varchar(35);
BEGIN
  payload = json_build_object( 
    'action', TG_OP,
    'table',  TG_TABLE_NAME::regclass::text,
    'data',  json_build_object( 
    'UUID', NEW.UUID,
    'Mod_Ctr', ctr) 
   );
     
  IF NOT (COALESCE(OLD.Title,'')  =  COALESCE(NEW.Title,'') 
     AND  COALESCE(OLD.Parent_ID,-1) =  COALESCE(NEW.Parent_ID,-1) 
     AND  COALESCE(OLD.Short_Name,'') =  COALESCE(NEW.Short_Name,'') 
     ) THEN 
    -- NEW.Simple_Location := Simpleword(new.Location);
    INSERT INTO Modified(Mod_Ctr, UUID, Updated)
    ValueS(ctr, NEW.UUID, upd);
     
    UPDATE Main_Record 
    SET Updated = Upd
    WHERE UUID = NEW.UUID;
  
  SELECT 
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Title::text, ''::text))), 'A'::"char") ||
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Short_Name::text, ''::text))), 'B'::"char") ||
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Parent::text, ''::text))), 'C'::"char") || 
     setweight(to_tsvector('Simple'::regConfig, unAccent(COALESCE(', '::text || p1.Ref_Type::text, ''::text))), 'D'::"char") VecSimpleName
     
  INTO VecSimpleName
  FROM 
   (SELECT 
      r.ID, r.Title, r.Short_Name, 
      COALESCE(p.Title,'') Parent, y.Title Ref_Type
      --Simpleword(r.Title::text ||  ', '::text || r.Short_Name || ', '::text ) Simple_Name,
      --Simpleword(COALESCE(', '::text || p.Simple_Name,'')) Parent, Simpleword(y.Title) Ref_Type
    FROM 
      (SELECT new.Id, new.Parent_Id, new.Title, new.Short_Name, new.Type_Id) r
    INNER JOIN Reference_Type y on y.Id = r.Type_Id
    LEFT JOIN Reference p on r.Parent_Id = p.Id
    ) p1;
    
    IF (NEW.Type_Id <> OLD.TYPE_Id) THEN
      reftype := (SELECT Title FROM Reference_Type WHERE ID = NEW.Type_Id);
      NEW.Ref_Type = reftype;
    END IF;
  
    NEW.Vec_Simple_Name = VecSimpleName;

    PERFORM pg_notify('mychan', payload::text);   
  END IF;
 
RETURN NEW;
END; 
$function$;
 
DROP TRIGGER IF EXISTS trgReference_Ins on Reference;
---------------------------------------------------------------------------
CREATE TRIGGER trgReference_Ins
---------------------------------------------------------------------------
    BEFORE INSERT ON Reference
    FOR EACH ROW
    EXECUTE PROCEDURE Reference_INSERT();

DROP TRIGGER IF EXISTS trgReference_upd on Reference;
---------------------------------------------------------------------------
CREATE TRIGGER trgReference_upd
---------------------------------------------------------------------------
    BEFORE UPDATE ON Reference
    FOR EACH ROW
    WHEN (OLD.* IS DISTINCT FROM NEW.*)
    EXECUTE PROCEDURE Reference_UPDATE();

DROP TRIGGER IF EXISTS trgReference_del on Reference;
---------------------------------------------------------------------------
CREATE TRIGGER trgReference_del
---------------------------------------------------------------------------
    AFTER DELETE ON Reference
    FOR EACH ROW 
    EXECUTE FUNCTION trgGenericDelete();

INSERT INTO Reference(Code, Short_Name, Title, Type_ID) 
SELECT 0 Code,'NA' Short_Name ,'NA' Title,  y.ID
FROM Reference_Type y
WHERE Title = 'NA'
ON CONFLICT( Type_ID, COALESCE(Parent_ID,0), lower(Title) ) 
DO NOTHING;

--------------------------------------------
-- CREATE Reference View
--------------------------------------------
CREATE OR REPLACE VIEW public.vwReference
AS SELECT 
    rf.ID, mr.UUID,
    typ.ID AS Type_ID, rf.Code, typ.Title AS Ref_Type,

    p.ID AS Parent_ID, p.UUID AS ParentUUID, p.Code AS Parent_Code,
    p.Title AS Parent, rf.Short_Name, rf.Title,
 
    ptyp.ID AS Parent_Type_ID, ptyp.UUID AS Parent_Ref_TypeUUID,
    ptyp.Title AS Parent_Ref_Type,
    rf.Remark,

    mr.Mod_Ctr,
    rf.Other_Info,
    mr.Created,
    mr.Updated 
   FROM Reference rf
     INNER JOIN Main_Record mr on mr.UUID = rf.UUID
     INNER JOIN Reference_Type typ ON rf.Type_ID = typ.ID
     LEFT JOIN Reference p ON rf.Parent_ID = p.ID
     LEFT JOIN Reference_Type ptyp ON p.Type_ID = ptyp.ID;

