)   
  a(RefType, ParentRef_Type, Code, Parent, Short_Name, Title, Lvl, Remark)
  INNER JOIN Reference_Type f on lower(f.Title) = lower(a.RefType)
 -- WHERE lower(a.Ref_Type) = 'churchfunditem' and a.title = 'General Assembly Meeting'
  ORDER BY lvl ;

  i integer;
  _Parent_ID bigint;
  BEGIN
     -- Open the cursor
    Open cur;   
    LOOP
      FETCH cur INTO rec;
      -- exit when no more row to fetch
      EXIT WHEN NOT FOUND;
      SELECT r.ID into _Parent_ID 
      FROM vwReference r
      WHERE lower(r.Title) = lower(rec.Parent) and lower(r.Ref_Type) = lower(rec.ParentRef_Type);
      
      IF _Parent_ID is not null or COALESCE(rec.Parent,'') = '' THEN
        INSERT INTO Reference(Code, Short_Name, Title, Parent_ID, Type_ID, Remark)
        ValueS(rec.Code, Cast(rec.Short_Name as character varying(50)),
          CAST(rec.Title as character varying(200)), _Parent_ID, rec.Type_ID, rec.Remark)
        ON CONFLICT (Type_ID, COALESCE(Parent_ID,0), lower(Title) ) 
         -- DO NOTHING=
        DO UPDATE SET 
          Code = EXCLUDED.Code, 
          Short_Name = EXCLUDED.Short_Name, 
          Title = EXCLUDED.Title, 
          Parent_ID = EXCLUDED.Parent_ID,
          Type_ID = EXCLUDED.Type_ID,
          Remark = EXCLUDED.Remark;    
        
      END IF;
    END LOOP;  
   -- Close the cursora
    CLOSE cur;

  END; $$ ;


